import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/pages/Home';
import About from './components/pages/About';
import Jobs from './components/pages/Jobs';
import User from './components/pages/User';
import Admin from './components/pages/Admin';
import NotFound from './components/pages/NotFound';
import PrivateRoute from './components/PrivateRoute';
import './App.css';
import authService from './services/auth.service';



function App() {

  const loggedIn = authService.getCurrentUser();

  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path={["/", "/home"]} exact component={Home} />
          <Route path='/about' component={About} />
          <Route path='/jobs' component={Jobs} />
          {
            loggedIn != null && loggedIn.role === "ROLE_USER" ?
              <PrivateRoute path="/user" loggedIn={loggedIn} component={User} /> : (
                loggedIn != null && loggedIn.role === "ROLE_ADMIN" &&
                <PrivateRoute path='/admin' loggedIn={loggedIn} component={Admin} />
              )
          }

          <Route component={NotFound} />
        </Switch>
        <Footer />
      </Router>

    </>
  );
}

export default App;
